import React from "react";
import Carousel from "react-bootstrap/Carousel";

const ImageCarousel = () => {
  return (
    <div>
      <Carousel>
        <Carousel.Item>
          <img
            className="image-carousel"
            style={"width: 10vw;"}
            src={`http://drive.google.com/uc?export=view&id=1LEiHDydZutzE3fhKjY80TUQgPTKNCepM`}
            alt="First slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="image-carousel"
            src={`http://drive.google.com/uc?export=view&id=1LEiHDydZutzE3fhKjY80TUQgPTKNCepM`}
            alt="Second slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="image-carousel"
            src={`http://drive.google.com/uc?export=view&id=1LEiHDydZutzE3fhKjY80TUQgPTKNCepM`}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

export default ImageCarousel;
